function Forms() {

    const formSubmit = (e) => {
        e.preventDefault()
    }

    return (
        <div>
           <form onSubmit={formSubmit}>
                <input name='name' placeholder="name"/>
                <input name='age' placeholder="age" />
                <input name='profile' placeholder="profile" />
                <button>Submit-Form</button>
            </form>
        </div>
    )
}
export default Forms
